songs.lyrics:
Les mages savent pas danser, connaissent pas tous les pas
Les mages savent pas danser, des livres plein les bras {x2}
Quand ils dansent à l’endroit, piétinent la queue du chat
Quand ils dansent à l’envers, foutent les bouquins par terre {x2}
Et puis ça leur fait mal, et puis ça leur fait mal {x2}

Les nains savent pas danser, connaissent pas tous les pas
Ils s’en vont picoler, c’est moins dangereux comme ça {x2}
Quand ils dansent à l’endroit, ça fait bougеr le gras
Quand ils dansent à l’envеrs, ils répandent la bière {x2}
Et puis ça leur fait mal, et puis ça leur fait mal {x2}

Les elfes y savent danser, connaissent bien tous les pas
Mais ils savent pas tirer, ont pas l’talent pour ça {x2}
Quand ils tirent à l’endroit, la cible n’est plus là
Quand ils tirent à l’envers, ils repartent en civière {x2}
Et puis ça leur fait mal, et puis ça leur fait mal {x2}

Sauron voudrait danser, connaît bien tous les pas
Sauron voudrait danser, mais vraiment il peut pas {x2}
Il rêvait de bouger ses pieds sur un parquet
Il rêvait de tutu, pour tortiller du cul
(Il rêvait de bouger ses pieds sur un parquet
Il rêvait de tutu... mais c’est seulement un oeil)
Et puis c’est ridicule, et puis c'est ridicule {x4}

(nan, mais c'est vrai, c'est juste un oeil le gars, tu vois, il a pas d'jambes, il peut pas danser, c'est pas hyper pratique d'être un oeil en fait)

Les orques savent pas danser, connaissent pas tous les pas
Les orques savent pas danser, sont trop bourrins pour ça {x2}
Quand ils dansent à l’endroit, ils font voler des bras
Quand ils dansent à l’envers, ils éborgnent leurs frères {x2}
Et puis ça leur fait mal, et puis ça leur fait mal {x2}

Les barbares ne dansent pas, veulent pas connaître les pas
Les barbares ne dansent pas, trop compliqué pour ça {x2}
Quand tu leur joues du blues, ils te traitent de tarlouze
Quand tu joues du musette, ils te démontent la tête {x2}
Et puis ça nous fait mal, et puis ça nous fait mal {xX}

(parce que le mec c'est seulement un oeil, tu comprends ce que je dis ?)
